import React, { Component } from 'react';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Tv series List</h1>
        </header>
          <p className="App-intro">
            Edit <code>src/App.js</code> and save to reload.
          </p>

      </div>
    );
  }
}

export default App;
